//CUADRO DE BUSQUEDA DEL NAVBAR
function palabraClave() {
    var keyword = document.getElementById("searchInput").value.toLowerCase();


    if (keyword === "") {
        alert("Ingrese dato a buscar. ");
        return;
    }


    var sections = document.querySelectorAll('main section, main article'); //BUSCA EN SECCION Y ARTICULO TAMBIEN

    var found = false;

    sections.forEach(function (section) {
        var sectionText = section.textContent.toLowerCase();
        if (sectionText.includes(keyword)) {
            window.scrollTo({
                top: section.offsetTop,
                behavior: 'smooth'
            });
            found = true;
            return;
        }
    });

    if (!found) {
        alert("La búsqueda se limita a la página donde usted se encuentra, pruebe con otra palabra.");
    }
}


