////////////////////////// C   O   T   I   Z   A   D   O   R ////////////////////////


function calcular() {
    var trayecto = parseFloat(document.getElementById('trayecto').value);
    var peso = parseFloat(document.getElementById('peso').value);
    var costo = trayecto * peso;

    if (document.getElementById('seguro').checked) {
        costo += 10;
    }

    if (document.getElementById('paqueteriaPremium').checked) {
        costo += 15;
    }

    document.getElementById('resultado').innerText = "El costo de envío es: $" + costo.toFixed(2);

    //HABILITAR EL BOTON DE IMPRIMIR PDF
    document.getElementById('imprimirBtn').disabled = false;

}

function limpiarCampos() {
    document.getElementById('trayecto').value = '2.55';
    document.getElementById('peso').value = '';
    document.getElementById('seguro').checked = false;
    document.getElementById('paqueteriaPremium').checked = false;
    document.getElementById('resultado').innerText = '';


    //DESABILITAR EL BOTON CUANDO SE LIMPIEN LOS CAMPOS
    document.getElementById('imprimirBtn').disabled = true;

}



//GENERADOR DE PDF'S
