    var paqueteriaPremium = document.getElementById('paqueteriaPremium').checked ? 'Sí' : 'No';
    var resultado = document.getElementById('resultado').innerText;
    var pdf = new jsPDF();

    //IMAGEN DEL ECABEZADO DEL PDF
    var imgData = 'data:image/jpeg;base64,';  
    pdf.addImage(imgData, 'JPEG', 1, 30, 200, 40);  


//PIE DE PAGINA
var imgData = 'data:image/png;base64,';  
pdf.addImage(imgData, 'JPEG', 5, 260, 200, 31);




//ENCABEZADO
var imgData = 'data:image/png;base64,';  
pdf.addImage(imgData, 'JPEG', 5, 10, 200, 7);



// TITULO
pdf.setFontSize(20);
pdf.setTextColor(0, 0, 255);
