//REFERENCIAS DE TODOS LOS CAMPOS DEL FORMULARIO
var politicaCheckbox;
var enviarBtn;

window.onload = function() {
    politicaCheckbox = document.querySelector('input[name="politica_privacidad"]');
    enviarBtn = document.querySelector('.btn-success');

    //SUBMIT
    document.getElementById('contactForm').addEventListener('submit', function(event) {
        //EVITAR LA RECARGA DE LA PÁGINA
        event.preventDefault();

        //VALIDACION NOT NULL
        if (!politicaCheckbox.checked) {
            //NOT NULL
            document.getElementById('mensajeResultado').innerText = 'Complete todos los campos';
        } else {
            //APARECE UN LABEL CON EL TEXTO DE ENVÍO
            document.getElementById('mensajeResultado').innerText = 'Mensaje enviado';
        }
    });
}